import { Table, Tag, Space, Card } from 'antd';
import * as dummy from './dummydata'
import './styles.css'

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
    render: text => <a>{text}</a>,
  },
  {
    title: 'Age',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
    key: 'address',
  },
  {
    title: 'Tags',
    key: 'tags',
    dataIndex: 'tags',
    render: tags => (
    //   <>
    //     {tags.map(tag => {
    //       let color = tag.length > 5 ? 'geekblue' : 'green';
    //       if (tag === 'loser') {
    //         color = 'volcano';
    //       }
    //       return (
    //         <Tag color={color} key={tag}>
    //           {tag.toUpperCase()}
    //         </Tag>
    //       );
    //     })}
    //   </>
    // ),
        <>
          {tags.map(tag => (
            <Tag color="pink" style={{backgroundColor:"transparent"}} key={tag}>
              {tag}
            </Tag>
          ))}
        </>
      )
  },
  {
    title: 'Action',
    key: 'action',
    render: (text, record) => (
      <Space size="middle">
        <a>Invite {record.name}</a>
        <a>Delete</a>
      </Space>
    ),
  },
];



const Session = () => {
    return ( 
        // <div style={{fontSize:'10px', color:'white'}}>
        //     Session
        // </div>
            <Table 
            pagination={false}
            style={{borderRadius:'20px', backgroundColor:'#3A3C41', padding:'20px', boxShadow: '0px 0px 20px 1px #202225'}} 
            columns={columns} 
            dataSource={dummy.data} />

     );
}

export default Session;
